            name : "INFY",
            index : "Nifty50",
            quantity : 100
        }

        // store.buyStock(data,"Shravan")
        console.log(store.stocks, store.buyers)
        
    }



    return (
        <>
        <div class = "example">
            <div>
               <button onClick = {buyStockOne}>Buy Stock</button>
                <div>My Stocks :</div>

            </div>
        </div>
        </>
    )
}
